- Квартира на 18 этаже 19 -этажного монолитно-каркасного дома.
- Прекрасные виды из окна;
- Площадь квартиры по СНБ - 34,6 метра;
- Панорамные окна с усиленными, небьющимися двухкамерными стеклопакетами и замками. Остекленная лоджия;
Преимущества дома:
- Дом построен в 2022 году.
- Отличное расположение: 500 метров ст.м. Аэродромная (2023 г.) ТЦ «Авиа Молл» и МФЦ, рядом действующая ст. метро «Ковальская слобода», удобные подъездные пути, хорошее транспортное сообщение;
- В доме 2 скоростных бесшумных лифта ОТIS, один из них с панорамным остеклением;
- Дизайнерские лобби с местом для консьержа, зоной отдыха, санитарной комнатой;
- Во дворе дома - детский сад;
- Парковка автомобиля -по периметру дома - удобная.
Описание квартиры:
Звоните 8.00-22.00! Записывайтесь на показ!
Поможем продать вашу квартиру для покупки этой!
